import React, { useState } from 'react';
import '../styles/formStyles.css';

const PropertyInputForm = ({ propertyInput, handleInputChange, handlePredictPrice, predictedPrice }) => {
    const [errors, setErrors] = useState({});

    const handleSubmit = (e) => {
        e.preventDefault();
        handlePredictPrice();
    };

    const bedroomOptions = [1, 2, 3, 4, 5];
    const bathroomOptions = [1, 2, 3, 4];

    return (
        <div className="form-container">
            <form className="form" onSubmit={handleSubmit}>
                <div className="input-group">
                    <label>Area:</label>
                    <input 
                        type="number" 
                        name="Area" 
                        value={propertyInput.Area} 
                        onChange={handleInputChange} 
                        required 
                    />
                    {errors.Area && <div className="error">{errors.Area}</div>}
                </div>
                <div className="input-group">
                    <label>Bedrooms:</label>
                    <div className="radio-buttons-container">
                        {bedroomOptions.map((num) => (
                            <div key={`bedroom-${num}`} className="radio-button">
                                <input
                                    type="radio"
                                    id={`bedroom-${num}`}
                                    name="Bedrooms"
                                    value={num}
                                    checked={parseInt(propertyInput.Bedrooms) === num}
                                    onChange={handleInputChange}
                                    className="radio-button__input"
                                    required
                                />
                                <label htmlFor={`bedroom-${num}`} className="radio-button__label">
                                    {num}
                                    <span className="radio-button__custom"></span>
                                </label>
                            </div>
                        ))}
                    </div>
                    {errors.Bedrooms && <div className="error">{errors.Bedrooms}</div>}
                </div>
                <div className="input-group">
                    <label>Bathrooms:</label>
                    <div className="radio-buttons-container">
                        {bathroomOptions.map((num) => (
                            <div key={`bathroom-${num}`} className="radio-button">
                                <input
                                    type="radio"
                                    id={`bathroom-${num}`}
                                    name="Bathrooms"
                                    value={num}
                                    checked={parseInt(propertyInput.Bathrooms) === num}
                                    onChange={handleInputChange}
                                    className="radio-button__input"
                                    required
                                />
                                <label htmlFor={`bathroom-${num}`} className="radio-button__label">
                                    {num}
                                    <span className="radio-button__custom"></span>
                                </label>
                            </div>
                        ))}
                    </div>
                    {errors.Bathrooms && <div className="error">{errors.Bathrooms}</div>}
                </div>
                <div className="input-group">
                    <label>Location:</label>
                    <div className="radio-input">
                        {['Downtown', 'Suburban', 'Rural'].map((location) => (
                            <label key={location}>
                                <input 
                                    type="radio" 
                                    id={location} 
                                    name="Location" 
                                    value={location} 
                                    checked={propertyInput.Location === location}
                                    onChange={handleInputChange}
                                    required
                                />
                                {location}
                            </label>
                        ))}
                        <span className="selection"></span>
                    </div>
                </div>
                <div className="input-group">
                    <label>Age of Property:</label>
                    <input 
                        type="number" 
                        name="Age of Property" 
                        value={propertyInput["Age of Property"]} 
                        onChange={handleInputChange} 
                        required 
                    />
                    {errors['Age of Property'] && <div className="error">{errors['Age of Property']}</div>}
                </div>
                <button className="btn-12" type="submit">
                    <span>Predict Price</span>
                </button>
            </form>

            {predictedPrice !== null && (
                <div className="form-container-predicted-price">
                    <h3 className="title">Predicted Price: ${predictedPrice.toLocaleString()}</h3>
                </div>
            )}
        </div>
    );
};

export default PropertyInputForm;
